import React, {useState, useEffect} from "react";
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    BarElement,
    Title,
    Tooltip,
    Legend,
} from 'chart.js'
import {Bar} from 'react-chartjs-2'

ChartJS.register(
    CategoryScale,
    LinearScale,
    BarElement,
    Title,
    Tooltip,
    Legend
)

const BarChart = () => {
    const [charData, setCharData] = useState({
        datasets: [],
    })


    const [chartOptions, setChartOptions] = useState({})

    useEffect(() => {
        setCharData({
            labels: ["John", "Kevin", "George", ""]
        })
    }, [])

    return <div>
        <h1>Chart</h1>
    </div>
}

export default BarChart
